import React from "react";
import "./App.css";
import NavbarMenu from "./components/Navbar";

function App() {
  return (
    <>
      <NavbarMenu />
      <header>
        <div className="div-header">
          <h1>ParkSys</h1>
          <h2>ParkSys</h2>
        </div>
      </header>
    </>
  );
}

export default App;
